import React, { Suspense, lazy, useState, useEffect } from 'react';
import Header from './Header';
import Footer from './Footer';
import styles from '../css/BookingFormLayout.module.css';

const BookingFormFields = lazy(() => import('./BookingFormFields'));

export default function BookingFormLayout() {
  // grab any UTM defaults from the URL
  const params = new URLSearchParams(window.location.search);

  // date range: today → seven days out
  const today = new Date();
  const sevenDays = new Date(today);
  sevenDays.setDate(today.getDate() + 7);

  // form state, seeded from UTM if present
  const [form, setForm] = useState({
    firstName: params.get('utm_firstName') || '',
    surname:   params.get('utm_surname')   || '',
    phone:     params.get('utm_phone')     || '',
    email:     params.get('utm_email')     || '',
    address:   params.get('utm_address')   || '',
    postcode:  params.get('utm_postcode')  || ''
  });

  const [slots, setSlots]             = useState([]);
  const [dates, setDates]             = useState([]);
  const [times, setTimes]             = useState([]);
  const [selectedDate, setSelectedDate] = useState('');
  const [selectedTime, setSelectedTime] = useState('');
  const [loading, setLoading]         = useState(false);
  const [error, setError]             = useState(null);

  // helper to format a Date to YYYY-MM-DD
  function formatDate(date) {
    return date.toISOString().split('T')[0];
  }

  // update form fields as the user types
  const handleChange = e => {
    const { name, value } = e.target;
    setForm(prev => ({ ...prev, [name]: value }));
  };

  // hit your /api/available-slots endpoint
  const fetchSlots = async () => {
    setLoading(true);
    setError(null);

    const clientId  = process.env.REACT_APP_CLIENT_ID;
    const clientRef = `MHS-${Date.now()}`;

    if (!clientId) {
      setError('Error: REACT_APP_CLIENT_ID is not set. Please add it to .env.local.');
      setLoading(false);
      return;
    }

    const payload = {
      clientId,
      clientRef,
      visitType:   'Service',
      postcode:    form.postcode,
      earliestDate: formatDate(today),
      latestDate:   formatDate(sevenDays)
    };

    try {
      const res = await fetch(
        `${process.env.REACT_APP_API_BASE_URL || 'http://localhost:3001'}/api/available-slots`,
        {
          method:  'POST',
          headers: { 'Content-Type': 'application/json' },
          body:    JSON.stringify(payload)
        }
      );
      if (!res.ok) throw new Error(`API Error: HTTP ${res.status}`);
      const { slots: fetched = [] } = await res.json();

      setSlots(fetched);
      // extract unique dates and reset downstream selections
      setDates(Array.from(new Set(fetched.map(s => s.visitDate))));
      setSelectedDate('');
      setTimes([]);
      setSelectedTime('');
    } catch (e) {
      setError(e.message);
      setSlots([]);
      setDates([]);
    } finally {
      setLoading(false);
    }
  };

  // whenever the selected date changes, rebuild the time slots
  useEffect(() => {
    if (!selectedDate) return;
    const available = slots
      .filter(s => s.visitDate === selectedDate)
      .map(s => `${s.windowStart}–${s.windowEnd}`);
    setTimes(available);
    setSelectedTime('');
  }, [selectedDate, slots]);

   return (
    <>
      <Header title="SHH Booking" />

      {/* card container */}
      <div className={styles.formCard}>
        <Suspense fallback={<p>Loading form…</p>}>
          <BookingFormFields
            form={form}
            onChange={handleChange}
            dates={dates}
            times={times}
            selectedDate={selectedDate}
            selectedTime={selectedTime}
            onDateChange={e => setSelectedDate(e.target.value)}
            onTimeChange={e => setSelectedTime(e.target.value)}
          />
        </Suspense>

        {error && (
          <p style={{ color: 'red', marginTop: '1rem' }}>{error}</p>
        )}

        <button
          className={styles.submitButton}
          onClick={fetchSlots}
          disabled={loading}
        >
          {loading ? 'Loading…' : 'Get Available Dates'}
        </button>

        {selectedDate && selectedTime && (
          <p style={{ marginTop: '1rem' }}>
            You selected: {selectedDate}, {selectedTime}
          </p>
        )}
      </div>

      <Footer />
    </>
  );
}
